  \"high-confidence-medical-devices-cyber-physical-systems-for-21st-century-health-care\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The U.S. market for medical devices is the
  largest in the world. At an estimated $83 billion in 2006, this market represents
  nearly half the global total and is growing at 6 percent annually ? about double
  the rate of U.S. GDP. With the advent of microprocessors, miniaturization of electronic
  circuits, wired and wireless digital networking, and new materials and manufacturing
  processes, older generations of mechanical and analog electromechanical devices
  used in patient diagnosis, monitoring, and treatment have largely been replaced
  by devices and systems based on information technologies across the diverse array
  of contemporary medical devices...\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
